When the user closes an editor, it should clean up local and global resources. E.g., a Salt document might not need to hold the reference to the actual annotation graph when it is not edited anymore. You can annotate a method of your editor with the @PreDestroy annotation to execute its code whenever the part is closed. Since several editors can open the same document at the same time, releasing it should not be performed directly, but by signaling an event over the IEventBroker of Eclipse RCP. When posting an event, you have to use the topic DOCUMENT_CLOSED and give the document ID as an argument. import javax.annotation.PreDestroy;
import org.corpus_tools.hexatomic.core.Topics; /* ... */ @PreDestroy
public void cleanup(MPart part) {
events.post(Topics.DOCUMENT_CLOSED, part.getPersistedState().get("org.corpus_tools.hexatomic.document-id"));
}

